// About.js
import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about">
      <h1>About Senior Connect</h1>
      <p>Senior Connect is a platform aimed at empowering seniors with essential digital skills.</p>
      
      <h2>Our Mission</h2>
      <p>To help seniors gain confidence in using technology to stay connected with loved ones and manage daily activities.</p>
      
      <h2>The Team</h2>
      <p>Our dedicated team is passionate about making technology accessible for everyone.</p>
    </div>
  );
};

export default About;
